import React from "react";
import MenuIcon from "@material-ui/icons/Menu";
import {
  AppBar,
  IconButton,
  Toolbar,
  Typography,
  Link,
  Button,
  Box,
} from "@material-ui/core";

export const Navbar = () => {
  return (
    <AppBar>
      <Toolbar>
        <Typography variant="h6">MovieDB</Typography>
        <Box justifyContent="center">
          <Button color="inherit">Newest</Button>
          <Button color="inherit">Hot</Button>
          <Button color="inherit">TV</Button>
          <Button color="inherit">Movie</Button>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
